(1, 'Ashu', 'Aaj Kaash part 1', '<p><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">\'Educational environment ar hum\'</span><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">Kuch batana chahta hu me bas. Na smjha raha hu na hi koi tarika bata raha hu zindagi jeene ka. Bas yeh meri kahani ke kuch vo hisse jaha mjhe \'agar\' ar \'kash\' shabd yaad aata he.To hua yeh ki 10vi me aate hi yeh smjh aane laga tha ki zindagi me paisa bht zaruri he ar use kamane ke kai tarike he. Par paisa to kasai ar pujari dono kamate he. To gortalab yeh he ki paisa izzat ke sath kamaya jaye. Ab paisa kamane ka humare pass ek hi tarika tha ki padhe ar kahi achese naukri pr lag jaye kyuki na humare pita ki koi dukaan thi na hi behisab paisa. To is padhai wali daudd me shamil hone ke liye pata chala ki state board me rahne se kuch nhi hoga. Sunte hi humne bhi CBSE me admission leliya. Vaha jakr hume to kuch khas badlaw mehsus nhi hua sivaye fee receipts ke. Par daudd me marksheet ar marksheet me cbse ka thappa imp he. Fr thoda padha to interest aya science me. Bhai 10vi ki science thi hi kuch achi. Jab tak hume chodd kr sabne yeh faisla krliya tha ki unhe 10vi k baad CA krna he ya Engg krni he. Akhir humare desh me do hi to career option hote he. Ar kuch acha background hua to papa ka business join krna he. To CA ar Engg me hume smjh aya ki Engg krna chahiye kyuki 10th ki science to achi he. Fr 10vi ka result aya jo umeed thi har baar ki tarah vesa nhi hua. Bht \"wanna be Engg or Doc\" ne result se phle hi coaching bhi join krli. Humre education system me coaching Sachin Tendulkar ki tarah he. Jo perform kesa bhi kre unke purane scoreboard ko dkh kr hi bhgwan maan liya jata he. Ab mountain dew ka ad tab dkha nhi tha to dar to lag rha tha competition exam se. Uprse 10th ki science achi thi pr uske baad ki nhi iska bhi ehsas hogya tha. Jese tese socha ki koi coaching choose krli jaye to pata chala ki jin coaching k scoreboard bade he vo hume choose krte he hum unhe nhi. Uske liye bhi test lete he. Simple sa logic he ki Engg me admission ke liye jo test dena he uski padhai ke liye jaha padhna he phele unhe test do. Are bhai agr hume aata itna to khudse padhne ki daring na krlete. Pr choddo baki logo ne join krliya koi na koi 2.5 lakh + test preparation coaching centre. Hum waha bhi late hogye. Jab tak yeh faisla kr paye ki coaching join krna he batch full hogya. Barhal jese tese 11vi nikli ar 12vi ka agaz hua. Ab tak humare kuch Engg me jane wale sipahi ne banduke chodd di thi. Ar kuch smjh gye ki unhe dusri battalion me jane ki zrurt he. Kuch kahne lage ki board pr focus kro jee mains k liye to drop lelenge ar kuch private teachers ke yaha jane lage is funde k sath ki coaching me bht bache he. Funny baat to yeh thi ki humre Hindustani bacho ko 35 -40 bacho ki class me 25 26 saal experience wale teachers ka smjh nhi aata pr 150+ bacho ki coaching me unhi teachers ka smjh aata he. Kyuki aaj bhi kai school teachers hi coaching centre me padha rhe h. Private teacher ka funda hume bhi smjh aya. Ar hum ne bhi dhundliye is baar apne Dronacharya bina der kare. Ar yeh bhi tah krliya ki bhaiya phle board krlo fr mains dekhenge. Pr \'fr\' kabhi hua he jo ab hota 12th hi ho payi. Mains ke no. to Pakistani cricket team ki English se bhi kharab aaye. Kher jo college hum aas pass me chahte the vo mil gaya. Ab upr ki line se itna to smjh gye hoge ki gov nhi private college. Kya yr kamaal krte ho. Gov mila hota to yh kahani kab ki likh di hoti. Akhir vaha jakr nhi padhne walo ka bhi swag alg hota he. Indian Youtube ke kai superstars inhi gov engg colleges ki den he..</span><br></p>', '<p><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">\'Educational environment ar hum\'</span><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">Kuch batana chahta hu me bas. Na smjha raha hu na hi koi tarika bata raha hu zindagi jeene ka. Bas yeh meri kahani ke kuch vo hisse jaha mjhe \'agar\' ar \'kash\' shabd yaad aata he.To hua yeh ki 10vi me aate hi yeh smjh aane laga tha ki zindagi me paisa bht zaruri he ar use kamane ke kai tarike he. Par paisa to kasai ar pujari dono kamate he. To gortalab yeh he ki paisa izzat ke sath kamaya jaye. Ab paisa kamane ka humare pass ek hi tarika tha ki padhe ar kahi achese naukri pr lag jaye kyuki na humare pita ki koi dukaan thi na hi behisab paisa. To is padhai wali daudd me shamil hone ke liye pata chala ki state board me rahne se kuch nhi hoga. Sunte hi humne bhi CBSE me admission leliya. Vaha jakr hume to kuch khas badlaw mehsus nhi hua sivaye fee receipts ke. Par daudd me marksheet ar marksheet me cbse ka thappa imp he. Fr thoda padha to interest aya science me. Bhai 10vi ki science thi hi kuch achi. Jab tak hume chodd kr sabne yeh faisla krliya tha ki unhe 10vi k baad CA krna he ya Engg krni he. Akhir humare desh me do hi to career option hote he. Ar kuch acha background hua to papa ka business join krna he. To CA ar Engg me hume smjh aya ki Engg krna chahiye kyuki 10th ki science to achi he. Fr 10vi ka result aya jo umeed thi har baar ki tarah vesa nhi hua. Bht \"wanna be Engg or Doc\" ne result se phle hi coaching bhi join krli. Humre education system me coaching Sachin Tendulkar ki tarah he. Jo perform kesa bhi kre unke purane scoreboard ko dkh kr hi bhgwan maan liya jata he. Ab mountain dew ka ad tab dkha nhi tha to dar to lag rha tha competition exam se. Uprse 10th ki science achi thi pr uske baad ki nhi iska bhi ehsas hogya tha. Jese tese socha ki koi coaching choose krli jaye to pata chala ki jin coaching k scoreboard bade he vo hume choose krte he hum unhe nhi. Uske liye bhi test lete he. Simple sa logic he ki Engg me admission ke liye jo test dena he uski padhai ke liye jaha padhna he phele unhe test do. Are bhai agr hume aata itna to khudse padhne ki daring na krlete. Pr choddo baki logo ne join krliya koi na koi 2.5 lakh + test preparation coaching centre. Hum waha bhi late hogye. Jab tak yeh faisla kr paye ki coaching join krna he batch full hogya.</span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"IMG_20200418_070504.jpg\" style=\"width: 977px;\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><br></span><br></p>', 'images/post_image478167838076976039186383.jpg', 11, 150, 'Publish', 'aseem aaj kaash', '0', '2020-04-18');
