(2, 'Ashu', 'AAJ-KAASH part 2', '<p><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">\"Meri mohabbat\"</span><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">Jese ki aapne ab tak padha ki bina kuch khas kiye humne engg krne k liye ek college join krliya. Ab tak humari battalion k sabhi sipahiyo ko aas pass hi kuch college mil gye ar baki kuch bahar k college join krke apni jeet ko jag ghoshit kia. Jaha humare desh me bina snapchat ar Insta pr update kiye nivala nhi liya jata vaha itni badi baat kese inse dur rhti. Dusre bade shehro me jate hi humare in sathiyo ne apne algav-vaad ki ghoshna shuru krdi. Ar isse hum bhi bin unke bole smjh gye ki vo sab jeet gye he. Har cheez me haar jeet hona to imp he. Unhe chodd kr humne apne college pr dhyan diya to yh paya ki humara college bhi lgbhg 55% se zyda bacho k liye vesa hi dusre bade shehro k college jesa tha. Yani ki jisko hum chota college smjh rhe the vo adhe se zyda bacho k liye badi jagah thi ar vo apne shehro k jeete hue sipahi the. College me aate hi logo ne naye naye shabdo k istemal se yh bhi sabit krdia ki abhi hume bht janna baki he. Jo spna hum apni ankho me liye chal rhe the vo to sabke hisab se na mumkim tha is umar me. Par ab humne soch lia to soch lia. Ek baat to batana rah hi gayi. Humari class me ajeeb ajeeb prakar ke praniyo se humara samna hua. Kuch engg krna hi nhi chahte the kuch ko engg ghr wale krwa rhe the ar kuch abhi bhi soch rhe the ki future me krna kya he science lena tha ya commerce. Kuch saal college me bina college jaye is tarah guzre ki mauhalle wale bache ab humko uncle bolne lage. Bhai dadhi badhana fashion he ar konsa hum Shahrukh he jo bina dadhi bhi ache lage. Kher ab to vo bhi dadhi rakhta h. Apne kaam me do baar fail hone k baad mjhe worldcup me India se har baar harne wale pak team members jesa feel ho rha tha. Sabse alag banna tha total alag hogye sabse. Pr ab soch sab jesa hi rahe the. Bhai rythm he phle confusion me science fr majboori me engg fr 3rd year tak enlightenment fr gate cat gmat gre ya sarkaari naukri ssc mppsc banking ki coaching join krna. Rhythm h bhai rythm h. Ab in saalo me jaane kya hua sab bade ho gye. Phle mohabbat hoti thi. College me humne roz mohabbat ke kayi prayayvachi dekhe. Bhai-bankr mohabbat, friendzone wali mohabbat , ar i need someone to be cool wali mohabbat. Sab mohabbat alag thi pr ek cheez same thi. Sab me logo ka \"Anurag Kashyap ji wala \'C\' word\" bana tha. Ab yh c banne ki awadhi kuch mohabbat me apke data pack k chlne wli limit se naap jaa skti h ar kuch ko sardi me maggie k thande hone k waqt se. Pyaar ar Maggie ab ek samaan h. Jese ki pyaar bhi ab 2 min me ho jata he. Pyaar me bhi jhut hota he jese hum sab jante h maggie do min me nhi banti. Pyaar bhi thodi der me thanda ho jata h. Ar thandi maggie ar thande pyaar ko koi nhi jhel skta. Ar zyda pyaar se ar maggie se bimar hone ki sambhavnaye he. Hume yeh sab pata tha fr bhi ek din hua yu ki usko aate hue dekha. Thodi der esa laga ki 3 idiots ka \'filmo me hota he\' wala concept sahi he. Ab hum yeh tah nhi kr paa rhe the ki ankhe mili dono ki muskuraye hum dono &nbsp;pr baat vo chalu kregi k hum. Hum baat kre to utawle na kre to attitude wale. Ar hum to bas unke samne ache banna chahte the. Saara failure bhul bhaal k khush hone ki vjha mil gyi thi. Ab hume kaam bhi kya tha socha spna bhi ab vhi &nbsp;he humara ar achievement bhi. Soch kr dil ki Dhadkan jo edm k music scene se bhi Loud jaa rhi thi thamte hue usko \'hey\' bola. Ab 10th se har exam k baad ar result se phle acting kj vjhse ab hum mahir hogye the. Nawazuddin to nhi ha Rajpal yadav se to better kr skte he. To feelings daba kr normal baat krne ki koshish ki. Ab response to aaya samne se. Khush hum bht the ghr jakr akele me naach bhi liye. Ab dusra din tha milne ka ab baat kre ya na kre yh soch kr pura din nikal dia ar baat nhi ki. Fr teesre din baat kri to yh paaya ki unhe yh acha nhi laga ki hume dusre din \'hi\' tak nhi kia na baat ki. Dosti ki shuruat humre dil me Guitar ar shyd unke dil me gudgudi ki shuruat ho gyi thi. Kuch bhi kaho yh humari pehli mohabbat thi. Sahi pakde he...!!! Isme me bhi hum saala late hogye.</span><br></p>', '<p><img src=\"data:image/jpeg;base64,\" data-filename=\"IMG_20200418_070504.jpg\" style=\"width: 25%;\"><br></p>', 'images/post_image8024964514939993115718460.jpg', 0, 58, 'Publish', 'aseem aaj kaash part-2', '0', '2020-04-18');
