(3, 'Ashu', 'AAJ-KAASH part 3', '<p><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">\"Firse shuru\"</span><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">Ab phela ishq to shuru hogya tha. Humari college bus me chlte gaane ab hume sunai dene lage the. Pata he ese me ek ajeeb si hulchul hoti h seene me ar lagta he ki un gaano ke hero hum hi he. Unke sath dkhi har picture me yahi lgta tha ki apn bhi villain ko maar ke hero bann hi jaenge. Ab baki sab vesa hi hua jesa aaj kal k pyaar me hota he. Bahar mulaqate, phone pr baatein, ar dosto se chhutte gaye saare naate. Ab srf unke liye hum the ar humre liye vo. Kamse kam esa hume laga. Par hua yu ki vo jo kahti thi ar hum jo sunna chahte the usme bht antar tha. Par ladki bht achi thi. Saara bollywood ka kia dhara he. Ladkiyo ko itna zyda objectify krdia he. Phle unhe besahara ar lachaar batate the ar ab gold digger. Jabki yeah dono hi baatein galt he. Aaj tak kisi ne actual ladki ko dkhayi hi nhi he. Humko to nhi lagta ladkiya apko barbaad krti he. Usne to hume zindagi jeena sikha diya. Ha hum apne dosto se dur hue. Par jo dost humre dil ki itni si baat na smjhe vo dost kaha. Unhone hume frse laddne ko kaha. Are bhai jung hi to he yeh startup krni ki journey. Humre desh me to ab startup culture bhi esa badh gaya he ki har 10 me se 4th admi ko krna he. Funding kuch ko milti he ar un funding ki news se inspiration hazaro ko. Par sab reaction bin catalyst k nhi hoti. Isley sab log startup nhi kr paate. Ab to humre pass bhi humra catalyst tha yeh soch kr fr apna startup ka basta uthaya ar fund raisers k bazaar me kisi ko humre idea me dum na lagi. Khud se chalu kia krna frse akhir is baar to vo sath thi na humre support me. Socha tha filmo jesa hoga ek ke baad ek hum kamyabi ki seedhi chadhte jaenge. Par filmo me jese dance ke time gaane me achanak se piche se logo ka aana ar same steps me dance krna jhut he. Unki kahaniyo me jldi se milne wali kamyabi bhi jhut he. To bhaiya aap ab tak hume judge to kr hi chuke honge fr bhi bata de ki hum frse fail hogye. Usne hume chodda nhi. Humari nakamyabi ne hume chodd dia. Akhir usko bhi to engg krne k baad IAS banna tha. Halaki me bata du engg k baad usne fr mtech kia fr IAS k teen fail attempt k baad ab filhaal vo US me bank me job kr rhi he. Sahi me kafi focused thi vo. Chalo choddo hum konsa abhi bill gates ban gaye the. Uske jaane k baad maano khalipan se itna bhar gye ki laga khokle ho gye. Itna to 3 baar fail startup ne nhi todda tha hume. Humne apni engg complete ki ar ek choti si company me naukri krli. Ek saal tak maano hum kalapaani ki saza kaat rhe the vo bhi us gunha k liye jo humne kia hi nhi. Khud ko smjha ar fr smjhaya. Fr aag jagayi seene me kuch krne ki. Ar lag gye office k baad research krne me. Kuch krne ki aag ko seene me jagana jitna aasan he utna hi mushqil he usko jalaye rkhna. 3 baar per tudwa kr doddne ka khawab liye chal rhe the. Vo ladki galt nhi thi na hi humre idea kyuki unhi idea pr based kai startup aaj successful he. Galt the to hum. Vo bhi isley the kyuki hum duniya ki sun rhe the. Itna sab krke itna to smjh aagya tha ki humara dil jo ek dum first time me bolta he na vhi sahi hota he baki sab farji he bhaiya. To yeah soch kr dil karra krke ar irada pakka krke is baar zyda aag ke saath laddne ka sochliya.</span><br></p>', '<p><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">\"Firse shuru\"</span><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">Ab phela ishq to shuru hogya tha. Humari college bus me chlte gaane ab hume sunai dene lage the. Pata he ese me ek ajeeb si hulchul hoti h seene me ar lagta he ki un gaano ke hero hum hi he. Unke sath dkhi har picture me yahi lgta tha ki apn bhi villain ko maar ke hero bann hi jaenge. Ab baki sab vesa hi hua jesa aaj kal k pyaar me hota he. Bahar mulaqate, phone pr baatein, ar dosto se chhutte gaye saare naate. Ab srf unke liye hum the ar humre liye vo. Kamse kam esa hume laga. Par hua yu ki vo jo kahti thi ar hum jo sunna chahte the usme bht antar tha. Par ladki bht achi thi. Saara bollywood ka kia dhara he. Ladkiyo ko itna zyda objectify krdia he. Phle unhe besahara ar lachaar batate the ar ab gold digger. Jabki yeah dono hi baatein galt he. Aaj tak kisi ne actual ladki ko dkhayi hi nhi he. Humko to nhi lagta ladkiya apko barbaad krti he. Usne to hume zindagi jeena sikha diya. Ha hum apne dosto se dur hue. Par jo dost humre dil ki itni si baat na smjhe vo dost kaha. Unhone hume frse laddne ko kaha. Are bhai jung hi to he yeh startup krni ki journey. Humre desh me to ab startup culture bhi esa badh gaya he ki har 10 me se 4th admi ko krna he. Funding kuch ko milti he ar un funding ki news se inspiration hazaro ko. Par sab reaction bin catalyst k nhi hoti. Isley sab log startup nhi kr paate. Ab to humre pass bhi humra catalyst tha yeh soch kr fr apna startup ka basta uthaya ar fund raisers k bazaar me kisi ko humre idea me dum na lagi. Khud se chalu kia krna frse akhir is baar to vo sath thi na humre support me. Socha tha filmo jesa hoga ek ke baad ek hum kamyabi ki seedhi chadhte jaenge. Par filmo me jese dance ke time gaane me achanak se piche se logo ka aana ar same steps me dance krna jhut he. Unki kahaniyo me jldi se milne wali kamyabi bhi jhut he. To bhaiya aap ab tak hume judge to kr hi chuke honge fr bhi bata de ki hum frse fail hogye. Usne hume chodda nhi. Humari nakamyabi ne hume chodd dia. Akhir usko bhi to engg krne k baad IAS banna tha. Halaki me bata du engg k baad usne fr mtech kia fr IAS k teen fail attempt k baad ab filhaal vo US me bank me job kr rhi he. Sahi me kafi focused thi vo. Chalo choddo hum konsa abhi bill gates ban gaye the. Uske jaane k baad maano khalipan se itna bhar gye ki laga khokle ho gye. Itna to 3 baar fail startup ne nhi todda tha hume. Humne apni engg complete ki ar ek choti si company me naukri krli. Ek saal tak maano hum kalapaani ki saza kaat rhe the vo bhi us gunha k liye jo humne kia hi nhi. Khud ko smjha ar fr smjhaya. Fr aag jagayi seene me kuch krne ki. Ar lag gye offic saath laddne ka sochliya.</span><br></p>', 'images/post_image61297146027634957334755.jpg', 1, 49, 'Publish', 'aaj kaash aseem part-3', '0', '2020-04-18');
