(4, 'Ashu', 'AAJ-KAASH part 4', '<span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">\"Ek step ar\"</span><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">To pichle chapter se aapko humari aag ke baare me pata chala gaya hoga. Ar bhaiya hindustan ki famous upbringing me humne pados wali auntiyo se aag me petrol ka kaam achese seekha he. Mauhalle ke bacho dwara ki gayi chhoti se chhoti vardaat ko atankwad ke roop me pesh karna in auntiyo ki ek abhin khala he. News reporter bhi is \'Petrol Bomb\' kala ki prerna in auntiyo se lete he.Isley humne bhi is baar is aag ko badhane k liye koi petrol dhundna shuru kiya. Naukri chodd kuch paise ikhatte kar dubara ghar lautte ar on-ground market research chalu kiya. Ar ek din city bus me ek humari hi engg battalion ka sipahi hume mila. Us se mil kr ar life me pehli baar baat krke humne jaana ki engg collego me bhheddo ki tarah bhare hue har bache ko us bheed se alag hokr kuch krna he. Par parivaar , yaar , rishtedaar ar risk ke bhaar ke karan vo yeh kadam akele utha nhi paate.Ar itni bheed ke karan vo zydatar samay apna koi sahi sathi bhi nhi dhund paate. Business model to engg ke collego ka bhi acha he jo paise BE / Btech ke lete he ar pure time hume life me kuch ar krne ke liye motivate krte he yeh guilt de dekr jese company hume select nhi kregi, Ya campus nhi aate yaha , gate ar cat me acha perform kro etc etc. Ar fr end year tak aate aate apas me hi competition krwake kuch IT companies ko yeh unskilled labour yani hume supply krwa dete he. Ab jo sipahi hume mila usne humari aag ko badha kr aag ka toofan bana diya. Ar hume apne aap pr is baat ka gussa aane laga ki humne usse phele dosti kyu nhi ki. Yeh tha humari is Jung ka main Commander jisko humre is ecosystem me kahte he Co-founder. Co-founder startup me ek dum married couple ki tarah hote he. Jese ek shadi ko chalane ke liye ek dusre ki khamiyo ko pura karna ar ek dusre ki skills ko balance krna imp he vese hi ek startup me ek dusre ka plus one banna bht imp he. Aap yeh samjh le bas is rishte me mangalsutra ki kami he baki sab same he.</span><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">Ek dusre ko sambhalte hue humne meri research ko aage badhaya ar ek idea par kaam shuru krdiya. Spoiler nhi he ha shyd bragging kah skte ho kyuki babu is baar hum fail nhi hue.</span>', '<p><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">\"Ek step ar\"</span><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\">To pichle chapter se aapko humari aag ke baare me pata chala gaya hoga. Ar bhaiya hindustan ki famous upbringing me humne pados wali auntiyo se aag me petrol ka kaam achese seekha he. Mauhalle ke bacho dwara ki gayi chhoti se chhoti vardaat ko atankwad ke roop me pesh karna in auntiyo ki ek abhin khala he. News reporter bhi is \'Petrol Bomb\' kala ki prerna in auntiyo se lete he.Isley humne bhi is baar is aag ko badhane k liye koi petrol dhundna shuru kiya. Naukri chodd kuch paise ikhatte kar dubara ghar lautte ar on-ground market research chalu kiya. Ar ek din city bus me ek humari hi engg battalion ka sipahi hume mila. Us se mil kr ar life me pehli baar baat krke humne jaana ki engg collego me bhheddo ki tarah bhare hue har bache ko us bheed se alag hokr kuch krna he. Par parivaar , yaar , rishtedaar ar risk ke bhaar ke karan vo yeh kadam akele utha nhi paate.Ar itni bheed ke karan vo zydatar samay apna koi sahi sathi bhi nhi dhund paate. Business model to engg ke collego ka bhi acha he jo paise BE / Btech ke lete he ar pure time hume life me kuch ar krne ke liye motivate krte he yeh guilt de dekr jese company hume select nhi kregi, Ya campus nhi aate yaha , gate ar cat me acha perform kro etc etc. Ar fr end year tak aate aate apas me hi competition krwake kuch IT companies ko yeh unskilled labour yani hume supply krwa dete he. Ab jo sipahi hume mila usne humari aag ko badha kr aag&nbsp;</span><img src=\"data:image/jpeg;base64,\" data-filename=\"SAVE_20200305_070732.jpg\" style=\"width: 584px;\"><br></p>', 'images/post_image9124715734663447948199701.jpg', 7, 8, 'Publish', 'aaj kaash aseem part-4', '0', '2020-04-18');
INSERT INTO `post` (`post_id`, `post_by`, `post_title`, `post_content`, `post_proof`, `post_img`, `post_like`, `post_views`, `post_status`, `post_keyword`, `post_cmnt`, `date`) VALUES
(5, 'ashu__01', 'It Happens...!!!', '<p><b style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(19, 79, 92); font-family: verdana, sans-serif;\"><span style=\"background-color: white;\">We all people hide many things inside us knowingly or unknowingly..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">these things can be anything like memories,incidents,stories of others</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">and movie clips etc. These all stuff is stored as a record of our</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">subconscious mind without knowledge of our conscious mind.. Human mind</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">is a complicated brain in all the other living ones.. Sometimes we</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">feel some sleep shocks,deja_vu,dreams of places we have never seen or</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">imagine and also talking in sleep to someone that don\'t exist..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Because of human nature of finding reasons and answers for all the</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">things going on and that\'s why when we fail to find one we create</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">one.. That\'s why things like magic,paranormal activities, and black</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">magic are still our reasons for many deeds of&nbsp; subconscious mind..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Sometimes our mind is filled with a unknown kind of sorrow and it\'s</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">the time when our subconscious one is triggered.. And it leads to a</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">many psychological and neurological disorders.. and remember a disorder</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">is not a disease.. and a person with a psychological&nbsp;disorder is not</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">insane until the conscious mind has control..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">There is a story about a incident which will explain us what can a</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">small part of brain can do..</span><br style=\"background-color: white;\"><br style=\"background-color: white;\"><span style=\"background-color: white;\">It was started at late 70\'s rain..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Dr. Moore was at the grand inauguration of the New Life psychological</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">treatment and research centre in mumbai..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">He was at stage explaining the cretinous public about the brain and</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">it\'s psychological effects..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">In the front row the members of the centre and also the rest crew was</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">couched.. They were also listening to their senior New York return Dr</span></span></b><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px;\"><b><span style=\"color: rgb(19, 79, 92); font-family: verdana, sans-serif;\">with concentration unlike rest of the bored audience.. After the</span></b></span><br style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"></p><div class=\"separator\" style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254); clear: both; text-align: center;\"></div><p><b style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(19, 79, 92); font-family: verdana, sans-serif;\"><span style=\"background-color: white;\">speech and publicity in reputed media networks in less than 3 months</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">the centre was full of the high society patients with a delicate anger</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">issues and rest of some small obsession disorders.. and divorced/</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">broken relationship guys.. In the leading staff Dr. Niroop Sharma, Dr.</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Swaroop Saxena,Dr Taran Malik and Dr. Raina Maheshwari were all</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">working efficiently..</span><br style=\"background-color: white;\"><br style=\"background-color: white;\"><span style=\"background-color: white;\">It was all settled now the routine timing for patients and research</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">work all were happy and so was Dr. Swaroop.. He was a 28 year old and</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">5 year experienced.. famous for his a little deep voice that make</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">patients more to listen him and the softness of his nature was</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">imprisoned in his voice every time he utter a single word.. It was</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">after a year of success when he met his one of a regular visitor Miss</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Ashika Sengal.. She was a young lady about age 24 25 and was in a</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">emotional trauma because of a breakup.. Dr Swaroop was her doc and in&nbsp;</span><span style=\"background-color: white;\">all 7 sessions he was mesmerised by her beauty and barely listened</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">her.. after these sessions they going against Dr patient relationship</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">get in touch as friends and then after 20 more meetings became an</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">unpredictable couple as they both like each other but as a Dr it was</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">wrong to be that soft cornered to love your patient.. But this was</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">diff from start.. Swaroop was mesmerised by Ashika\'s charm in her eyes</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">and Ashika has found a person who listen all about her and motivate</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">her in every situation...</span><br style=\"background-color: white;\"><br style=\"background-color: white;\"><span style=\"background-color: white;\">Today is 3 nov 1979 , 5:45 pm and Swaroop was at the centre packing</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">for going to meet Ashika.. It is more than a year now and they both</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">are planning to get married soon.. all is set there parents are ready</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">the only matter is now is date of wedding and planning for which he</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">and Ashika would talk today.. In between of getting his office bag</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">ready he heard someone calling his name in not so respective but a bit</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">hatting way..</span><span style=\"background-color: white;\">Dr. Raina she was his colleague and a very good person but her voice&nbsp;</span><span style=\"background-color: white;\">tone is now different completely.. it is rude insulting..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Dr Raina-\" He know nothing.. He is a stupid fake doc.. he is a moron</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">who is going to marry his innocent patient by manipulating her..\"</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Swaroop doesn\'t like this at all but it was first time Raina was</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">talking like this he wants to find the reason so he got up and move</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">very closer to her cabin which was just near his and know is listening</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">with a little much more concentration.. Raina continued she was not</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">talking to walls but Dr. Moore the owner and chairman of this health</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">centre.. Raina continued -\"&nbsp; I am going to get publish this on news</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">paper sir.. it\'s against law to hypnotise someone to marry\" she</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">yelled.. her eyes was red and was looking grumpy first time.. he</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">guessed it was a special meeting of Dr. Moore and Dr. Raina as they</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">both leave until this time.. He didn\'t want to believe his own</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">colleague which was more likely his friend is betraying him for</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">nothing.. He entered the room in thought of clearing everything but</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Dr. Moore stopped him and ordered him-\" Hey Mr. Saxena stop please..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">we are in a private meeting..\"</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Sawroop-\"But this is about me..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">and Miss Raina.. i don\'t believe you are dishonouring me for no reason</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">at all.. why are u doing this to me..?\" he said in a irritating</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">expressions..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Dr Raina pushed him a bit-\" You are a con and using psychology for your&nbsp;</span><span style=\"background-color: white;\">own good in a very wrong way you are a demon\"</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Swaroop jumped his hand out of her fold and in anger pushed her a bit</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">and seeing this Dr. Moore-\"What\'s this hell are you mad Saxena.. How</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">can u push a women like this.. Are u out of your mind..? Go away or i</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">will take strict actions..\"</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Hurt&nbsp;by this and also a litte&nbsp;afraid of loosing his job Swaroop</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">stared Raina for a little time thinking to find reasons for what she</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">was insulting his innocence.. and finally for sake of his job he</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">leaves..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">In all his away to Ashika he continued re imagine the incident and</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">drive his car to her.. He was already in a bad mood and forgot that</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Ashika is with him.. Ashika asked him many times what happened? but he&nbsp;</span><span style=\"background-color: white;\">was not listening at all.. This was the time he seen Miss Raina</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">again.. she was with an unknown man and was staring him with anger and&nbsp;</span><span style=\"background-color: white;\">disgust.. Then he saw Ashika and quickly get her out of the restaurant&nbsp;</span><span style=\"background-color: white;\">they were seated in to the car and dropped her home only saying that&nbsp;</span><span style=\"background-color: white;\">he is not feeling well because he is a little sick.. he leave</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">immediately from her house.. It felt very weird to Ashika because he</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">never leaves without meeting her father but this time he was</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">different.. On Swaroop way back to his home he found Dr. Raina</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">following him.. He triggered the accelerator to speed up but she</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">followed him like a cat mouse chase.. finally there car were&nbsp; running</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">parallely near each other Raina is now alone in her car and she was</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">abusing him non stop he was too abusing her they were fighting arguing&nbsp;</span><span style=\"background-color: white;\">like they were goons not docs.. then Swaroop car was overtake by a&nbsp;</span><span style=\"background-color: white;\">truck and Swaroop was driving without seeing in front but concentrating&nbsp;</span><span style=\"background-color: white;\">on raina which was on left side.. the argument continued and Swaroop&nbsp;</span><span style=\"background-color: white;\">suddenly sees the truck which was very near to his car only&nbsp;</span><span style=\"background-color: white;\">maintaining the finger gap.. he quickly hit the brake and the car was&nbsp;</span><span style=\"background-color: white;\">just saved striking it just a bit.. he finally leaving Raina behind</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">reached home and gone straight to sleep to relax...</span></span></b><br></p>', '<p><b style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(19, 79, 92); font-family: verdana, sans-serif;\"><span style=\"background-color: white;\">We all people hide many things inside us knowingly or unknowingly..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">these things can be anything like memories,incidents,stories of others</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">and movie clips etc. These all stuff is stored as a record of our</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">subconscious mind without knowledge of our conscious mind.. Human mind</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">is a complicated brain in all the other living ones.. Sometimes we</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">feel some sleep shocks,deja_vu,dreams of places we have never seen or</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">imagine and also talking in sleep to someone that don\'t exist..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Because of human nature of finding reasons and answers for all the</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">things going on and that\'s why when we fail to find one we create</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">one.. That\'s why things like magic,paranormal activities, and black</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">magic are still our reasons for many deeds of&nbsp; subconscious mind..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Sometimes our mind is filled with a unknown kind of sorrow and it\'s</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">the time when our subconscious one is triggered.. And it leads to a</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">many psychological and neurological disorders.. and remember a disorder</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">is not a disease.. and a person with a psychological&nbsp;disorder is not</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">insane until the conscious mind has control..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">There is a story about a incident which will explain us what can a</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">small part of brain can do..</span><br style=\"background-color: white;\"><br style=\"background-color: white;\"><span style=\"background-color: white;\">It was started at late 70\'s rain..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Dr. Moore was at the grand inauguration of the New Life psychological</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">treatment and research centre in mumbai..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">He was at st</span></span></b></p><p><b style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(19, 79, 92); font-family: verdana, sans-serif;\"><span style=\"background-color: white;\">reached home and gone straight to sleep to relax...</span></span></b><br></p>', 'images/post_image4573175366327254258883257.jpg', 0, 4, 'Publish', 'happens', '0', '2020-04-18');
