(7, 'ashu__01', 'It Happens...!!! 3', '<p><b style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(19, 79, 92); font-family: verdana, sans-serif;\"><span style=\"background-color: white;\">Mr. and mrs Saxena was crying also was Ashika.. Dr. Moore was shocked</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">for not noticing Swaroop\'s disorder.. Then Dsp asked\" Why only Raina</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">and Joshi.. was in his thought..?\" Dr.Taran\"&nbsp; There can be many</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">reasons some can be in existence some are only Swaroop sees.. Actually&nbsp;</span><span style=\"background-color: white;\">anyone can be his target but because Raina was closed to Dr. Moore and&nbsp;</span><span style=\"background-color: white;\">also a very known socialite.. among Doctors and patients.. she also&nbsp;</span><span style=\"background-color: white;\">arrange many parties and thus to Swaroop she was the one who cares&nbsp;</span><span style=\"background-color: white;\">about wrong and good in the society.. Also she approached to him as&nbsp;</span><span style=\"background-color: white;\">she was his friend and a good colleague but because of Ashika Swaroop&nbsp;</span><span style=\"background-color: white;\">never give her priority.. This was all in Swaroop\'s mind for Raina to&nbsp;</span><span style=\"background-color: white;\">be the main villain for him and Mr. Joshi was the only authority in&nbsp;</span><span style=\"background-color: white;\">the society whom which Swaroop knows also he was an orthodox type of&nbsp;</span><span style=\"background-color: white;\">person which whole society knew.. and once Raina told us in a party&nbsp;</span><span style=\"background-color: white;\">she knew Joshi somehow.. i was there too at that time.. this</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">particular thing was the reason Swaroop created Joshi as his second</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">villain..\"</span><br style=\"background-color: white;\"><br style=\"background-color: white;\"><span style=\"background-color: white;\">Ashika\" How he can be treated is there is any medicine..?.. Help him</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">doc plz.. He is innocent he was not him when he was doing this all..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Some devil was inside him..\" Dr. Taran-\" plz take care of yourself</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Ashika.. He will be fine but he is in a very&nbsp; critical condition.. we</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">can\'t tell him the truth now i will do my best..\"</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">all leaves the meeting but 3 people was left crying Ashika who was</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">dead to the person she wants to live for.. Swaroop\'s father who worked</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">all his life to make him a successful man.. and Swaroop\'s mother who</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">was still believing that her good boy is caught by a ghost.. And there</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">was Swaroop lying on a chair chained in a closed room laughing on all</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">who were telling him that Ashika is alive..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">After court has sentenced Swaroop for 1 year in rehabilitation and 7</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">years in jail.. Swaroop was taken by police to gov rehabilitation</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">centre for mentally ill patients.. while going to van he saw his</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">parents and cried loud to say\" sorry BaBa\".. and smiled seeing</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Ashika.. and said to himself \"hehe i still hallucinate about her.. she</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">is beautiful more in dreams..!!\" and laughed..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Ashika cried and prayed to see him again..</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">In way to rehabilitation Swaroop snatched a gun and shoots himself</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">saying\"Sorry Baba.. m coming Ashika..\"</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">Ashika is still waiting to see him..</span><br style=\"background-color: white;\"><br style=\"background-color: white;\"><span style=\"background-color: white;\">A part of a mind can destroy many lives.. and can also create many..</span><br style=\"background-color: white;\"><br style=\"background-color: white;\"><span style=\"background-color: white;\">Devils Call..</span></span><br style=\"background-color: white; font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-family: arial, sans-serif;\"><span style=\"background-color: white; font-size: 12.8px;\"><span style=\"color: rgb(53, 28, 117);\">BY-&nbsp;</span><i><u><span style=\"color: rgb(39, 78, 19);\">ASEEM JOHRI</span></u></i></span></span></b><br></p>', '<p><b style=\"color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 15px; background-color: rgb(243, 253, 254);\"><span style=\"color: rgb(19, 79, 92); font-family: verdana, sans-serif;\"><span style=\"background-color: white;\">Mr. and mrs Saxena was crying also was Ashika.. Dr. Moore was shocked</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">for not noticing Swaroop\'s disorder.. Then Dsp asked\" Why only Raina</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">and Joshi.. was in his thought..?\" Dr.Taran\"&nbsp; There can be many</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">reasons some can be in existence some are only Swaroop sees.. Actually&nbsp;</span><span style=\"background-color: white;\">anyone can be his target but because Raina was closed to Dr. Moore and&nbsp;</span><span style=\"background-color: white;\">also a very known socialite.. among Doctors and patients.. she also&nbsp;</span><span style=\"background-color: white;\">arrange many parties and thus to Swaroop she was the one who cares&nbsp;</span><span style=\"background-color: white;\">about wrong and good in the society.. Also she approached to him as&nbsp;</span><span style=\"background-color: white;\">she was his friend and a good colleague but because of Ashika Swaroop&nbsp;</span><span style=\"background-color: white;\">never give her priority.. This was all in Swaroop\'s mind for Raina to&nbsp;</span><span style=\"background-color: white;\">be the main villain for him and Mr. Joshi was the only authority in&nbsp;</span><span style=\"background-color: white;\">the society whom which Swaroop knows also he was an orthodox type of&nbsp;</span><span style=\"background-color: white;\">person which whole society knew.. and once Raina told us in a party&nbsp;</span><span style=\"background-color: white;\">she knew Joshi somehow.. i was there too at that time.. this</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">particular thing was the reason Swaroop created Joshi as his second</span><br style=\"background-color: white;\"><span style=\"background-color: white;\">villain..\"</span><br style=\"background-color: white;\"></span><br style=\"background-color: white; font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-family: arial, sans-serif;\"><span style=\"background-color: white; font-size: 12.8px;\"><span style=\"color: rgb(53, 28, 117);\">BY-&nbsp;</span><i><u><span style=\"color: rgb(39, 78, 19);\">ASEEM JOHRI</span></u></i></span></span></b><br></p>', 'images/post_image794489058838036285212587.jpg', 0, 40, 'Publish', 'happens', '0', '2020-04-18');

